import React from 'react';
import Organism from './Organism';
type OrganismListState = {
    organisms: Array<string>,
}
class OrganismList extends React.Component<{}, OrganismListState> {
    constructor(props: OrganismListState) {
        super(props);
        this.state = {
            organisms: []
        }
    }


    render() {
        return (
            <div>
                this.state.organisms.forEach(organism => {
                    <Organism />
                });
            </div>
        )
    }
}

export default OrganismList;
